import React from "react";
import { Header } from "../../components/header";
import {
  Column,
  Container,
  CriarText,
  RecuperarText,
  SubTitle,
  Text,
  TitleHighLight,
  TitlePrincipal,
  Wrapper,
} from "./styles";
import Button from "../../components/button";
import { Input } from "../../components/Input/Input";

const Login = () => {
  return (
    <>
      <Header />
      <Container>
        <Column>
          <img src="./logo.png" />
        </Column>
        <Column>
          <TitlePrincipal>Faça seu cadastro</TitlePrincipal>
          <SubTitle>Faça o seu Login e make a change...</SubTitle>
          <form>
            <Input placeholder="Digite seu Email" />
            <Input placeholder="Digite sua Palavra Passe" />
            <Button title="Login" variant="secondary" />
          </form>
          <CriarText>criar conta</CriarText>
          <RecuperarText>recuperar palavra passe</RecuperarText>
        </Column>
      </Container>
    </>
  );
};

export { Login };
